INSERT INTO `tbl_job` (`id`, `topic`, `content`, `filename`) VALUES
(7, 'บริษัทดี-อินท์-อัพ ประกาศรับสมัครบุคคลตำแหน่งพนักงานช่างยนต์', 'บริษัทดี-อินท์-อัพ ประกาศรับสมัครบุคคลตำแหน่งพนักงานช่างยนต์ จำนวน 1 อัตรา', 'inc.PDF'),
(17, 'สมัครงานร้านท้อปวิว เชียงใหม่', 'รับสมัครงานด่วน\r\nร้านท้อปวิว เชียงใหม่ ตั้งอยู่ที่ห้อง 4105 อาคารพันธ์ทิพย์พลาซ่า เชียงใหม่\r\nเลขที่ 152 /1ถ.ช้างคลาน ต.เมือง  จ.เชียงใหม่\r\nรับสมัคร ช่างติดตั้งกล้องวงจรปิด จำนวน 4 ตำแหน่ง เพศชายอายุ 21-25 ปี  วุฒิ ปวช.\r\nคุณสมบัติ     \r\n             -  ขยัน อดทน ซื่อสัตย์\r\n             -  สุขภาพแข็งแรง สมบูรณ์\r\nไม่จำเป็นต้องมีประสบการณ์   สนใจติดต่อด่วน  คุณต๊กตา  โทร 084-3665675  ,053-288285\r\n', ''),
(18, 'รับสมัครงานวุฒิปวช.', ' ประกาศ            \r\nห้างหุ้นส่วนจำกัดเชียงใหม่ โทรศัพท์ เซลล์แอนด์เซอร์วิส\r\nรับสมัครพนักงาน วุฒิ ปวช. ขึ้นไป\r\nสนใจติดตามรายละเอียด  ตามเอกสารแนบ', 'in550247.pdf'),
(9, 'IT Support (ประจำการที่ จ.เชียงใหม่)', 'IT Support (ประจำการที่ จ.เชียงใหม่)\r\n1.รับผิดชอบการบริหารภาพรวมของสื่อ สามารถเป็นช่างเทคนิคคอมพิวเตอร์/Support ได้\r\n2.วางระบบหรือประสานงานด้านระบบไอทีเป็น\r\n3.ประเมินผลและพัฒนาระบบอย่างต่อเนื่อง\r\n4.วางยุทธศาสตร์การตลาดด้านไอทีบริษัทฯ\r\nอัตรา	1\r\nเงินเดือน	6,500-15,000\r\nสวัสดิการ	1.ประกันสังคม\r\n2.พิจารณาปรับเพิ่มเงินเดือนปีละ1ครั้ง\r\n3.โบนัสพิเศษปีละ2ครั้ง\r\n4.ท่องเที่ยวประจำปีปีละ1ครั้ง\r\n5.อื่นๆ\r\nคุณสมบัติผู้สมัคร :    	\r\n1.		ชายหรือหญิงอายุไม่เกิน 59ปี\r\n2.		ปวช.หรือปวส.ขึ้นไป มีประสบการณ์ด้าน IT2 ปีขึ้นไป\r\n3.		ขยัน ซื่อสัตย์ อดทน พัฒนาตนเองและระบบอย่างต่อเนื่อง\r\n4.		มนุษยสัมพันธ์ดี\r\n5.		มีบุคลิกแห่งการเป็นผู้นำงานไอที ใจเย็น มีคุณธรรม นำองค์กรสู่ความก้าวหน้า\r\nหมายเหตุ :    	\r\n298/5 อาคารชิโคโธกุ2 ม.3 ต.สันผักหวาน อ.หางดง จ.เชียงใหม่ 50230\r\nจากแยกสนามบินวิ่งมา5กม.ซ้ายมือผ่าน โลตัสหางดง บิ๊กซี และแม็คโคร เจอสี่แยกสะเมิงเลี้ยวซ้ายไปทางสารภีประมาณ1500ม.สังเกตด้านขวาติดถนน เห็นอาคารแฝดหลังคาสีแดง มีป้ายบอกว่าอาคารชิโคโธกุ2ขึ้นมาชั้น2\r\nหรือโทร080-502-5112,085-154-7722หรือ053-482766\r\nสถานที่ปฏิบัติงาน	298/5 อาคารชิโคโธกุ2 ม.3 ต.สันผักหวาน อ.หางดง จ.เชียงใหม่ 50230\r\nจังหวัด	เชียงใหม่\r\nวิธีการรับสมัครงาน	1.ส่งประวัติส่วนพร้อมประวัติการทำงานพร้อม**รูปถ่าย**และระบุเงินเดือนที่ต้องการส่งไปที่\r\nshicotolku-chiangmai@hotmail.com(สำหรับจ.เชียงใหม่) หรือ\r\n2ส่งจดหมายพร้อมหลักฐานการสมัครงานติดรูปถ่ายส่งมาตามที่อยู่สำนักงานใหญ่ บริษัท ชิโคโธกุ เรียลเอสเตท เอคอร์ป จำกัด (คุณ ปัญ์กร สรณ์ธเกล้า) เลขที่ 88/2 ซ.รามคำแหง53 แขวง/เขต วังทองหลาง กรุงเทพฯ10310 (สมัครทำงานทั้งในกรุงเทพฯและจ.เชียงใหม่ให้ส่งไปที่สำนักงานใหญ่)\r\n3.สอบถามเพิ่มเติม hotline ที่ 080-502-5112 ,08-5154-7722(10.00น.-17.00น.)\r\n4.บริษัทฯขอสงวนสิทธิ์ และงดรับการกรอกใบสมัครโดยการ walk in บริษัทฯจะคัดเลือกจากใบสมัครที่ส่งมา และกรอกข้อมูลครบถ้วนตามระบุเท่านั้น เพื่อพิจาราณาเรียกนัดสัมภาษณ์ในขั้นตอนต่อไป\r\nบริษัท ชิโคโธกุ เรียลเอสเตท เอคอร์ป จำกัด\r\nติดต่อ : ปัญ์กร สรณ์ธเกล้า\r\nสาขาเชียงใหม่298/5อาคารชิโคโธกุ2 สันผักหวาน หางดง เชียงใหม่ โทร080-502-5112,085-154-7722,053-482766 สำนักงานใหญ่เลขที่ 88/2 ซ.รามคำแหง53 แขวง/เขต วังทองหลาง กรุงเทพมหานคร 10310\r\nโทรศัพท์ :02-935-2885,02-935-2102    Fax : 02-935-2102\r\nhttp://www.shicotolku.com (กำลังปรับปรุงอีก5เว็ปไซด์)', ''),
(10, 'สมัครงานบริษัท บี ควิก เชียงใหม่', '\r\n\r\nศิษย์เก่าแผนกช่างยนต์ที่สนใจสมัครงานโปรดอ่านรายละเอียด', 'bquic.doc'),
(11, 'ร้านแอร์โช้คอัพ  ต้องการพนักงานช่างยนต์', 'ร้านแอร์โช้คอัพเชียงใหม่  ต้องการพนักงานช่างกลึง จำนวน 5 คน พนักงานช่วงล่าง จำนวน 5 คน\r\nโปรดติดต่อด่วน ที่คุณเพ็ญศรี แก้วมูล โทร 053-277304, 053-818909\r\nเลขที่ 335 /12 ถ.เจริญประเทศ  ต.ช้างคลาน อ.เมือง จ.เชียงใหม่\r\n       ฝากประกาศ วันที่ 12 มกราคม 2555', '23654d01.pdf'),
(12, 'วันนัดพบแรงงาน  25 กุมภาพันธ์  55', 'วันนัดพบแรงงาน  25 กุมภาพันธ์  55  ณ ห้องกาดดอย โรงแรมโลตัสปางสวนแก้ว เวลา 9.00 -16.00 น.\r\nเชิญนักศึกษาที่สนใจไปสมัครงานได้  ข่าวประชาสัมพันธ์จาก สำนักงานจัดหางานเชียงใหม่', 'in550156.pdf'),
(15, 'โรงแรม Hotel M', 'ประกาศ         โรงแรม Hotel M Chiangmai  \r\nเปิดรับสมัครงานสนใจอ่านในรายละเอียด', 'HotelM.pdf'),
(16, 'โรงแรม Hotel M', 'ประกาศ         โรงแรม Hotel M Chiangmai  \r\nเปิดรับสมัครงานสนใจอ่านในรายละเอียด', 'HotelM.pdf'),
(14, 'รับสมัครงานปิดเทอมภาคฤดูร้อน', '', '01.pdf'),
(19, 'สำนักงานจัดหางานจังหวัดเชียงใหม่ รับสมัครผู้รับการฝึกอบรมเพื่อจัดส่งไปฝึกงานเทคนิคที่ประเทศญี่ปุ่น', 'สำนักงานจัดหางานจังหวัดเชียงใหม่รับสมัครผู้ฝึกอบรมเพื่อจัดส่งไปฝึกงานเทคนิคประเทศญี่ปุ่นโดยผ่านองค์กร IM', 'in550328.pdf'),
(20, 'บ.เอเซียพรีซิชั่น จำกัด(มหาชน) โรงงานผลิตชิ้นส่วนรถยนต์และอุปกรณ์อิเล็กทรอนิคนิคมฯ จ.ชลบุรี แจ้งประชาสัมพันธ์ร่วมงานกับบริษัทสำหรับนศ.ที่จบการศึกษาแล้ว', 'บ.เอเซียพรีซิชั่น จำกัด(มหาชน) โรงงานผลิตชิ้นส่วนรถยนต์และอุปกรณ์อิเล็กทรอนิคนิคมฯ จ.ชลบุรี รับสมัครพนักงานประจำฝ่ายผลิตจำนวนมาก ', 'in550296.pdf'),
(21, 'บ.นิ่มซีเส็งรถยกจำกัด รับสมัครบุคคลที่จบสาขาช่างยนต์เข้าทำงาน', 'บ.นิ่มซีเส็งรถยกจำกัด รับสมัครบุคคลเข้าทำงาน โดยเฉพาะสาขาช่างยนต์ ช่างกล และสาขาที่เกี่ยวข้อง สนใจสอบถามข้อมูลการสมัครงาน ติดต่อ 053-306560,053-306619,053-247614', ''),
(22, '', '', ''),
(23, 'หจก.นครพิงค์ รับสมัครเจ้าหน้าที่เข้าทำงานในตำแหน่ง ช่างไฟฟ้า วุฒิ ปวช.-ปวส. 3 อัตรา', 'แจ้งศิษย์เก่าเมโทร หจก.นครพิงค์ รับสมัครเจ้าหน้าที่เข้าทำงานในตำแหน่ง ช่างไฟฟ้า วุฒิ ปวช.-ปวส. 3 อัตรา สนใจติดต่อสอบถามได้ที่ หจก.นครพิงค์ โทร 053-411114,225622', 'in550373.pdf'),
(24, 'บ.อัครพร็อบเพอร์ตี้ จำกัด ประกาศรับสมัครงานพนักงานประจำในตำแหน่งช่างประจำอาคาร 2 ตำแหน่ง', '               บ.อัครพร็อบเพอร์ตี้ จำกัด ขออนุญาตประชาสัมพันธ์ ประกาศรับสมัครงานพนักงานประจำในตำแหน่งช่างประจำอาคาร 2 ตำแหน่ง ติดต่อสอบถามได้ที่คุณสุวีณา เนตรสุวรรณ โทร 053-404190 ในเวลาทำการ จันทร์-ศุกร์ 09.00 น. - 18.00 น.', 'in550398.pdf'),
(25, 'บ.ควอลิตี้ ออโต้ เซอร์วิส จำกัด รับสมัครช่างติดตั้งฟิล์มรถยนต์/ช่างประดับยนต์ 2 อัตรา', '             บ.ควอลิตี้ ออโต้ เซอร์วิส จำกัด รับสมัครช่างติดตั้งฟิล์มรถยนต์/ช่างประดับยนต์จำนวน 2 อัตรา คุณสมบัติ เพศชาย วุฒิการศึกษา ระดับปวช.ขึ้นไป (สายช่าง) มีสวัสดิการคือ ประกันสังคมและเบี้ยเลี้ยงตามจำนวนชั่วโมง สนใจสามารถสมัครด้วยตนเองที่ บริษัทควอลิตี้ ออโต้ เซอร์วิส จำกัด ถ.ศิริธร ต.ช้างเผือก อ.เมือง จ.เชียงใหม่ หรือโทร 089-8506694 (คุณน้ำหวาน)', ''),
(31, 'บริษัท We.TV รับสมัครช่างจำนวน  4  อัตรา ด่วน!!', '    บริษัท We.TV รับสมัครช่างจำนวน  4  อัตรา คุณสมบัติ จบการศึกษาระดับ ปวส.สาขาอิเล็กทรอนิกส์หรือสาขาเทคนิคคอมพิวเตอร์ สนใจสมัครติดต่อผ่านรุ่นพี่ศิษย์เก่าเมโทร พี่ฐานันดร  เบอร์โทรศัพท์ 086-6739422', ''),
(29, 'ศูนย์วิเคราะห์แร่ธาตุและระบบกรองน้ำ ลานา ประกาศรับสมัครงาน ได้แก่ ช่างไฟฟ้า/ผช.ช่างไฟฟ้า และช่างประปา/ผช.ช่างประชา', '               ศูนย์วิเคราะห์แร่ธาตุและระบบกรองน้ำ ลานา ประกาศรับสมัครงาน ได้แก่ ช่างไฟฟ้า/ผช.ช่างไฟฟ้า และช่างประปา/ผช.ช่างประชา เพศชายผ่านการเกณฑ์ทหารแล้ว วุฒิการศึกษาระดับ ปวช.-ปวส. สนใจสามารถยื่นใบสมัครพร้อมสัมภาษณ์ได้ที่ หจก.ลานาลิติค วอเตอร์เอร์ค 219/6-7 ถ.ช้างเผือก ต.ช้างเผือก อ.เมือง จ.เชียงใหม่ (ตรงข้ามมหาวิทยาลัยราชภัฎเชียงใหม่ ใกล้สะพานลอย ปากซอยวัดเจดีย์ปล่อง) โทรศัพท์ 053-410182-3 วันจันทร์ - เสาร์ ตั้งแต่เวลา 10.00 น. - 16.00 น.', 'in550539.pdf'),
(30, ' บ.เวนคอน ซัพพลาย แอนด์เทคโนโลยี จำกัด ประกาศรับสมัครงานบุคคลและนศ.ฝึกงานที่ศึกษาวิชาช่างเครื่องปรับอากาศ เพื่อเข้าทำงานในตำแหน่งช่างซ่อมบำรุงเครื่องปรับอากาศหลายอัตรา', '                 บ.เวนคอน ซัพพลาย แอนด์เทคโนโลยี จำกัด ประกาศรับสมัครงานบุคคลและนศ.ฝึกงานที่ศึกษาวิชาช่างเครื่องปรับอากาศ เพื่อเข้าทำงานในตำแหน่งช่างซ่อมบำรุงเครื่องปรับอากาศหลายอัตรา ให้ผู้ประสงค์จะสมัครกรอกใบสมัครด้วยตนเองได้ที่บริษัทเวนคอน ซัพพลาย แอนด์เทคโนโลยี จำกัด เลขที่ 153/89 หมู่ 8 ต.หนองจ๊อม อ.สันทราย จ.เชียงใหม่ หมายเลขโทรศัพท์ 053-345679 หรือ 089-7001045 ในวันจันทร์-เสาร์ เวลา 08.30 น. - 17.30 น.', 'in550652.pdf'),
(32, 'ข่าวแจ้งประชาสัมพันธ์ สำนักงานจัดหางานจังหวัดเชียงใหม่จัดวันนัดพบแรงงานสำหรับประชาชนผู้ว่างงาน', '         แจ้งประชาสัมพันธ์จากสำนักงานจัดหางานจังหวัดเชียงใหม่จัดวันนัดพบแรงงานสำหรับประชาชนผู้ว่างงาน ในวันเสาร์ที่  24 พฤศจิกายน 2555 ตั้งแต่เวลา 09.00 - 16.00 น. ณ ห้องกาดดอย โรงแรมโลตัสปางสวนแก้วเชียงใหม่ เพื่อช่วยเหลือด้านการหางานทำให้แก่ประชาชนผู้ว่างงาน ผู้ถูกเลิกจ้าง และคนพิการ ได้มีโอกาสสมัครงานพร้อมรับการสัมภาษณ์งานกับนายจ้างโดยตรง', 'in550881.pdf'),
(33, 'แจ้งข่าวประชาสัมพันธ์ที่ว่าการอำเภอสันกำแพงรับสมัครลูกจ้างชั่วคราวตำแหน่งเจ้าหน้าที่ปกครอง', '      ที่ว่าการอำเภอสันกำแพงรับสมัครลูกจ้างชั่วคราวตำแหน่งเจ้าหน้าที่ปกครอง  คุณสมบัติสำเร็จการศึกษาไม่ต่ำกว่าชั้นมัธยมศึกษาปีที่  6  หรือเทียบเท่า มีความรู้ความชำนาญด้านคอมพิวเตอร์ อัตราเงินเดือน 6,900  บาท  สนใจสมัครหรือติดต่อสอบถามได้ที่ ที่ทำการปกครองอำเภอสันกำแพง จังหวัดเชียงใหม่ โทร 053-332412 หรือติดต่อโดยตรงที่ปลัดวิมลรัตน์ หลอดเข็ม โทรศัพท์ 089-5522105 ภายในวันที่ 30 พฤศจิกายน 2555 นี้ค่ะ', 'in550951.pdf'),
(34, 'บ.นิคส์วิศวกรรม จำกัด ผู้เชียวชาญงานด้านระบบสระว่ายน้ำและเคมีภัณฑ์สำหรับสระว่ายน้ำ รับสมัครช่างทั่วไปหลายอัตรา สนใจสอบถามรายละเอียดเพิ่มเติมได้ที่บ.นิคส์วิศวกรรม จำกัด(สาขาเชียงใหม่)', 'บ.นิคส์วิศวกรรมจำกัด ผู้เชียวชาญงานด้านระบบสระว่ายน้ำและเคมีภัณฑ์สำหรับสระว่ายน้ำ รับสมัครช่างทั่วไปหลายอัตรา สนใจสอบถามรายละเอียดเพิ่มเติมได้ที่บ.นิคส์วิศวกรรม จำกัด(สาขาเชียงใหม่) โทร 053-806238', 'in550983.pdf'),
(35, 'ที่ว่าการอ.สันกำแพง รับสมัครลูกจ้างชั่วคราวในตำแหน่งเจ้าหน้าที่ปกครอง โดยสำเร็จการศึกษาไม่่ต่ำกว่าขั้ม.6หรือเทียบเท่า มีความรู้ด้านคอมฯ  รับสมัครจำนวน 2 อัตรา คัดเลือกนศ.หรือบุคคลทีี่อาศัยในอ.สันกำแพง', 'ที่ว่าการอ.สันกำแพง รับสมัครลูกจ้างชั่วคราวในตำแหน่งเจ้าหน้าที่ปกครอง โดยสำเร็จการศึกษาไม่่ต่ำกว่าขั้ม.6หรือเทียบเท่า มีความรู้ด้านคอมฯ  รับสมัครจำนวน 2 อัตรา คัดเลือกนศ.หรือบุคคลทีี่อาศัยในอ.สันกำแพง\r\nรับสมัครตั้งแต่วันที่ 17-23 มกราคม 2556 เวลา 08.30 - 16.30 น. (เว้นวันหยุดราชการ) ณ ที่ทำการปกครองอำเภอสันกำแพง ที่ว่าการอำเภอสันกำแพง จ.เชียงใหม่ สอบถามรายละเอียดเพิ่มเติม 0-5333-2412', 'in560038.pdf'),
(36, 'หจก.ไทยรุ่งกิจอลูมิเนียม รับสมัครช่างผลิต-ติดตั้งประตู หน้าต่าง กระจก อลูมิเนียม', 'หจก.ไทยรุ่งกิจอลูมิเนียม รับสมัครช่างผลิต-ติดตั้งประตู หน้าต่าง กระจก อลูมิเนียม คุณสมบัติเพศชายอายุ 18 ปีขึ้นไป จบการศึกษาระดับปวช. ปวส. มีสวัสดิการประกันสังคม เบี้ยขยัน ค่าล่วงเวลา บุคคลที่สนใจสมัครได้ที่หจก.ไทยรุ่งกิจอลูมิเนียม โทรศัพท์ 053-410139', 'in560163.pdf'),
(37, 'บ.ท่าอากาศยานไทย จำกัด(มหาชน) ขอความอนุเคราะห์ประชาสัมพันธ์การรับสมัครบุคคล เพื่อสอบคัดเลือกเป็นพนักงานและจ้างเป็นลูกจ้างชั่วคราว ณ ท่าอากาศยานชม.และท่าอากาศยานแม่ฟ้าหลวงชร.วันที่18มี.ค.-18เม.ย.56', '  บ.ท่าอากาศยานไทย จำกัด(มหาชน) ขอความอนุเคราะห์ประชาสัมพันธ์การรับสมัครบุคคล เพื่อสอบคัดเลือกเป็นพนักงานและจ้างเป็นลูกจ้างชั่วคราว ณ ท่าอากาศยานชม.และท่าอากาศยานแม่ฟ้าหลวงชร.วันที่18มี.ค.-18เม.ย.56 รายละเอียดดังเอกสารแนบค่ะ', 'in560242.pdf'),
(38, 'บริษัทบิซิเนส เซอร์วิสเซส อัลไลแอนซ์ จำกัด', '     บริษัทบิซิเนส เซอร์วิสเซส อัลไลแอนซ์ จำกัด  (BSA) ซึ่งเป็นบริษัทในกลุ่มบริษัทปตท.จำกัด(มหาชน) รับสมัครงานจำนวนหลายอัตรา รายละเอียดสามารถดูได้ในลิงค์เว็บไซต์ http://www.pttbsa.com/Index.asp?pageld-175', ''),
