(48, 'บ.นูแมพ จำกัด ประกาศรับสมัครนศ.ฝึกงานภาคฤดูร้อนปี57', 'บ.นูแมพ จำกัด ประกาศรับสมัครนศ.ฝึกงานภาคฤดูร้อนปี57 ณ จ.อุดรธานี หรือ จ.เชียงใหม่ตามภูมิลำเนา จำนวนหลายอัตรา ค่าจ้าง 350 บาท/สัปดาห์ รายละเอียดตามเอกสารแนบค่ะ', 'in570009.pdf'),
