(52, 'บ.ชัยพัฒนาขนส่งเชียงใหม่จำกัด ขอความอนุเคราะห์ประชาสัมพันธ์ตำแหน่งงานว่าง ให้แก่นศ.และศิษย์เก่าที่มีความสนใจตำแหน่งว่างงาน ', 'บ.ชัยพัฒนาขนส่งเชียงใหม่จำกัด รับสมัครงานจำนวน 3 อัตรา สนใจสมัครได้ที่บริษัท หรือ Tel 053-241933 ต่อ 402', 'in570364.pdf'),
(54, 'บ.ซันสวีท ประชาสัมพันธ์รับสมัครงาน ระด้ับปวช.และปวส.และป.ตรี เพื่อเข้าร่วมปฏิบัติงาน และจัดหางานรองรับให้กับนศ.ที่จบจากสถาบัน', 'บ.ซันสวีท ประชาสัมพันธ์การรับสมัครงาน ระด้ับปวช.และปวส.และป.ตรี เพื่อเข้าร่วมปฏิบัติงาน และจัดหางานรองรับให้กับนศ.ที่จบจากสถาบัน โดยรับสมัครงานฝ่ายผลิต ฝ่ายงานเหมา และพนักงานขับรถรับ-ส่งพนักงานจำนวนมาก หากสนใจติดต่อสอบถามได้ที่ บ.ซันสวีทจำกัด โทร 053-830555 ต่อ 25 หรือ 0856950097 แผนกบุคคล', 'in570470.pdf'),
(55, '', '', ''),
(56, 'ประกาศรับสมัครงานบริษัทเอ็มเอ็มพี', ' บริษัทเอ็มเอ็มพี ผู้นำด้านการผลิตและจัดจำหน่ายฟิล์มยืดถนอมอาหาร ฟิล์มพัันเลท และบรรจุภัณฑ์อื่นๆท่ได้รับการยอมรับทั้งในตลาดภายในประเทศและต่างประเทศ ซึ่งบริษัทกำลังขยายสาขาในจังหวัดต่างๆทั่วประเทศ จึงต้องการรับสมัครบุคลากรตำแหน่งพนักงานขาย และพนักงานบัญชีจำนวนมาก ติดต่อสมัครงานได้ที่ สำนักงานใหญ่ (ฝ่ายบุคคล) โทรศัพท์ 02-7418444', '10602862_482030311900233_810162108_n.pdf'),
